const bp90="#073C48";
const bp80="#094A59";
const bp70="#0B5A6B";
const bp60="#0C6882";
const bp50="#0E788F";
const bp40="#3E93A5";
const bp30="#6BAEBA";
const bp20="#9FC9D2";
const bp10="#CFE4E9";

function rangeHandler(metadata, cell) {
  let bgColor ='';
  let color='#FFFFFF';
  let value = parseFloat(cell.value);
  if (value == 1) {
  bgColor = bp90;
  } else if (value > 0.9) {
  bgColor = bp80;
  } else if (value > 0.75) {
    bgColor = bp70;
  } else if (value > 0.6) {
    bgColor = bp60;
  } else if (value > 0.5) {
  bgColor = bp50;
  } else if (value > 0.4) {
    bgColor = bp40;
  } else if (value > 0.3) {
  bgColor = bp30;
  color = '#000000';
  } else if (value > 0.15) {
  bgColor = bp20;
  color = '#000000';
  } else {
    bgColor = bp10;
  color = '#000000';
  }
  cell.style = cell.style || {};
  cell.style.backgroundColor = bgColor;
  cell.style.color = color;
}

widget.transformPivot({
   type: ['value']
}, rangeHandler);



